# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.db.models.Model~Subclass
    - rssplugin
    - Member[cms_plugins].Member[RSSPlugin]
  - - Django.db.models.Model~Subclass
    - rssplugin
    - Member[models].Member[CMSPlugin]
  - - Django.db.models.Model~Subclass
    - rssplugin
    - Member[models].Member[RSSPlugin]
  - - django.forms.BaseForm~Subclass
    - rssplugin
    - Member[cms_plugins].Member[RSSPluginForm]
